import React from 'react';
import './Footer.css';

const Footer = () => {
  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  const footerSections = {
    services: [
      { name: 'Fullstack Prototyping', onClick: () => scrollToSection('services') },
      { name: 'Strategic Consulting', onClick: () => scrollToSection('services') },
      { name: 'Workforce Education', onClick: () => scrollToSection('services') },
      { name: 'Architecture Design', onClick: () => scrollToSection('services') }
    ],
    company: [
      { name: 'About Us', onClick: () => scrollToSection('about') },
      { name: 'Contact', onClick: () => scrollToSection('contact') },
      { name: 'Careers', href: '#' },
      { name: 'Blog', href: '#' }
    ]
  };

  const socialLinks = [
    { icon: 'fab fa-linkedin', href: '#', label: 'LinkedIn' },
    { icon: 'fab fa-twitter', href: '#', label: 'Twitter' },
    { icon: 'fab fa-github', href: '#', label: 'GitHub' }
  ];

  return (
    <footer className="footer">
      <div className="container">
        <div className="footer-content">
          <div className="footer-section">
            <div className="footer-logo">
              <svg className="cactus-logo" width="40" height="40" viewBox="0 0 40 40" fill="none">
                <path d="M20 5C18 5 16.5 6.5 16.5 8.5C16.5 10.5 18 12 20 12C22 12 23.5 10.5 23.5 8.5C23.5 6.5 22 12 20 5Z" fill="var(--primary-color)"/>
                <path d="M20 12C18 12 16.5 13.5 16.5 15.5C16.5 17.5 18 19 20 19C22 19 23.5 17.5 23.5 15.5C23.5 13.5 22 19 20 12Z" fill="var(--primary-color)"/>
                <path d="M20 19C18 19 16.5 20.5 16.5 22.5C16.5 24.5 18 26 20 26C22 26 23.5 24.5 23.5 22.5C23.5 20.5 22 26 20 19Z" fill="var(--primary-color)"/>
                <path d="M20 26C18 26 16.5 27.5 16.5 29.5C16.5 31.5 18 33 20 33C22 33 23.5 31.5 23.5 29.5C23.5 27.5 22 33 20 26Z" fill="var(--primary-color)"/>
                <path d="M15 18C13 18 11.5 19.5 11.5 21.5C11.5 23.5 13 25 15 25C17 25 18.5 23.5 18.5 21.5C18.5 19.5 17 25 15 18Z" fill="var(--primary-color)"/>
                <path d="M25 18C23 18 21.5 19.5 21.5 21.5C21.5 23.5 23 25 25 25C27 25 28.5 23.5 28.5 21.5C28.5 19.5 27 25 25 18Z" fill="var(--primary-color)"/>
                <path d="M20 33C18 33 16.5 34.5 16.5 36.5C16.5 38.5 18 40 20 40C22 40 23.5 38.5 23.5 36.5C23.5 34.5 22 40 20 33Z" fill="var(--primary-color)"/>
              </svg>
              <span>CACTUS LABS AI</span>
            </div>
            <p>Empowering businesses with AI-driven solutions for the future.</p>
            <div className="social-links">
              {socialLinks.map((link, index) => (
                <a 
                  key={index}
                  href={link.href}
                  aria-label={link.label}
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  <i className={link.icon}></i>
                </a>
              ))}
            </div>
          </div>

          <div className="footer-section">
            <h4>Services</h4>
            <ul>
              {footerSections.services.map((service, index) => (
                <li key={index}>
                  <button onClick={service.onClick}>
                    {service.name}
                  </button>
                </li>
              ))}
            </ul>
          </div>

          <div className="footer-section">
            <h4>Company</h4>
            <ul>
              {footerSections.company.map((item, index) => (
                <li key={index}>
                  {item.onClick ? (
                    <button onClick={item.onClick}>
                      {item.name}
                    </button>
                  ) : (
                    <a href={item.href}>{item.name}</a>
                  )}
                </li>
              ))}
            </ul>
          </div>
        </div>

        <div className="footer-bottom">
          <p>&copy; 2024 Cactus Labs AI. All rights reserved.</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
